//Settings
var settings = {
  replacer: {
    smiles: false, //true - on, false - off
    youtubeTag: false, //true - on, false - off
    youtubeLink: false, //true - on, false - off
    codeTag: false, //true - on, false - off
    noneTag: false, //true - on, false - off
    other: true //true - on, false - off
  },
  gifts: false, //true - on, false - off
  comm: false, //true - on, false - off
  coins: 0, //0 - off, 1 - автосборщик, 2 - меняем стили
  events: {
    on: false, //true - on, false - off
    audio: false, //true - on, false - off
    driverVoice: false, //true - on, false - off // работает при audio: true // изменяет стандартные звуковые уведомления
                        //на голос DriverBlog
    interval: 7000, //не рекомендуется ставить меньше 3000. время задаётся в милисекундах (1с = 1000мс)
    tabs: false,  //true - on, false = off. включает настройку событий для каждой вкладки. если вы
          //собираетесь использовать не боле 1-3 вкладок или поставлен большой interval, то лучше выключить
    reverse: false   //true - при открытии новой вкладки обновление событий включены
            //false - при открытии новой вкладки обновление событий в ней выключается
            //reverce работает только если tabs принимает значение true
  },
  ads: {
    MobTop: false, //true - скрывать, false - показывать
    other: false //true - скрывать, false - показывать
  },
  online: false, //true - on, false - off
  scroller: {
    type: 0, //0 - выкл, 1 - как в вк, 2 - активна вся левая часть экрана, 3 - небольшой блок в углу
    speed: 1.73 //коэффицент скорости прокрутки
  }, 
  fixMenu: false, //true - on, false - off
  lastVisit: false, //true - on, false - off
  zoomer: { 
    typeZoom: 0, //0 - off, 1 - type1, 2 - type2
    minZoom: 2, //целое число. минимальное увеличение картинки
    maxZoom: 16, //целое число. максимальное увеличение картинки
    startZoom: 6 //целое число в диапозоне от minZoom до maxZoom. во столько раз увеличивает при первом наведении
  },
  hideMicroblog: false, //true - скрывать, false - нет
  doubleClick: false, //true - да, false - нет
  ban: false, //true - показывать все возможные причины бана, false - выкл
  hideMedal: false, //true - скрывать медали, false - показывать
  hideLeftPanel: false, //true - скрывать боковую панель, false - оставить
  newMessage: false, //true - показывать новые письма, как в вк. false - выкл
  commUpdate: 0, //интервал проверки на новые комы в теме в милисекундах. 0 - выключает функцию. Рекомендуемое значение 5000
  newComm: false, //true - изменять в списке сообществ ссыли на форум на ссылки на новые темы, false - выкл
  delButton: false, //true - добавить кнопку удаления файла/фото/видео, false - не добавлять
  smilesTip: false, //true - при наведении на смайлик появляется всплывающая подсказка с названием смайлика, false - выкл
  snow: false //true - снег идёт, false - снег не идёт (вот бы с погодой на улице так же...)
}
